	    3 ->
		skip_group_metric_descriptor(Rest, Key bsr 3, 0, F@_1,
					     F@_2, F@_3, F@_4, F@_5,
					     TrUserData);
	    5 ->
		skip_32_metric_descriptor(Rest, 0, 0, F@_1, F@_2, F@_3,
