    case Key of
      8 ->
	  d_field_distribution_value_count(Rest, 0, 0, F@_1, F@_2,
					   F@_3, F@_4, F@_5, TrUserData);
      17 ->
	  d_field_distribution_value_sum(Rest, 0, 0, F@_1, F@_2,
