				       F@_2, F@_3, TrUserData);
dfp_read_field_def_snapshot(<<>>, 0, 0, F@_1, F@_2, R1,
			    TrUserData) ->
    S1 = #{},
    S2 = if F@_1 == '$undef' -> S1;
