-compile({nowarn_unused_function,v_msg_node/3}).
-dialyzer({nowarn_function,v_msg_node/3}).
v_msg_node(#{} = M, Path, TrUserData) ->
    case M of
      #{identifier := F1} ->
	  v_msg_process_identifier(F1, [identifier | Path],
				   TrUserData);
      _ -> ok
    end,
    case M of
      #{library_info := F2} ->
	  v_msg_library_info(F2, [library_info | Path],
